(1, 'Padma Bank Limited', 'Padma Bank Limited, a fourth-generation bank, inaugurated operations on January 29, 2019, with a new vision and view to become a trusted custodian of financial assets belonging to all valued clients in Bangladesh. The Bank has occupied a unique position through a first-time-ever collaboration in the banking industry that records the inclusion of 4- state-owned commercial banks i.e. Sonali Bank Limited, Janata Bank Limited, Agrani Bank Limited & Rupali Bank Limited, and Investment Corporation of Bangladesh [ICB] as 68% stakeholders.\r\n\r\nWe strive for becoming the first choice of our customers as a distinct financial service provider- Trusted, Respected, and Valued by all our customers and stakeholders. Padma Bank is not growing just to get bigger. We are growing to satisfy the continued demand for a bank that focuses on service. We prioritize ensuring our quality, and integrity, and working with a customer-centric model of services and products. With 59 branches and about 1200 employees, our mix of competitive products, combined with a high level of service and a focus on relationships is an overwhelming value proposition for our customers.\r\n\r\nWe are committed to providing each relationship with an unmatched level of service. While we offer competitive products, services, rates, and technology, the level of service we provide and our commitment to building relationships is what sets us apart from our competitors.\r\n\r\nPadma Bank is backed by the safest and sound patrons and has a history of secure banking practices that would allow us to navigate through changing economic environments. Because of this, our shareholders, employees, customers, and communities can rely on us to be their banking partners for decades to come.', 1, 1, '2020-08-09 10:50:41', '2022-07-30 23:48:15', NULL);
